- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of your
    letter dated, April 10, 2009, referencing the 2009 Amended Pre General Monthly
    Report.  The Committee?s response is as follows:    1.\tThe contributions from
    Earthsource and Searcy, Denny Scarola Barnhart Ship were incorrectly included
    on the 01/31/09 report.  They have been removed from this amended report.  2.\tThe
    contribution from FEA Advocacy Fund was incorrectly included on the 01/31/09 report.
    \ The receipt has been removed from this amended report.  3.\tThe two contributions
    received from John Brunetti were, in fact, from two different donors.  The Committee
    has amended this report to reflect the suffix of Jr. after one of the donors to
    help clarify the difference.  4.\tThe receipt from DNC Battleground Fund has been
    changed to the correct donor name of 2008 Battleground Fund.  5.\tThe ID numbers
    from Federal Committee contributions have been reviewed and corrected as needed.
    \ 6.\tThe transfers from Castor For Congress and Obama For America have been re-classed
    to correctly report on line 12.  7.\tThe contributions to Federal Candidates have
    been re-classed to correctly reflect on line 23.  8.\tThe payments for Voter File
    have been correctly re-classed to reflect on Line 30.  The payments for Canvassing
    were not public communications nor were they FEA activities, therefore, they have
    been correctly reported on 21b.  9.\tThe payments for 441 a.d. authority have
    been correctly reported on Line 25.  10.\tThe payments for 441 a.d. authority
    have been correctly connected to the corresponding Federal Candidate and on Schedule
    F.  11.\tThe payments on Line 21b for Direct Mail, Postage, Printing, Printing/Graphics,
    Telecommunications, and Telephone Calls have been given more detailed purpose
    codes.  None of these payments were public communications nor were they FEA activity,
    therefore, they have been correctly reported on 21b.  12.\tThe payments for Literature
    have been given more detailed purpose codes.  .  None of these payments were public
    communications nor were they FEA activity, therefore, they have been correctly
    reported on 21b.  13.\tThe payments listed on Line 30b for Direct Mail, Literature,
    and Persuasion Mail, Persuasion Phone Calls, Persuasion Telephone Calls, and Vote
    by Mail have been correctly classed with the appropriate Federal Candidate if
    necessary.  None of these expenditures listed on Line 30b were expressed advocacy.
    \ 14.\tThe payments made for Equipment Expense, Equipment Rental, Event Deposit,
    Public Event Expense, Public Event Permit, and Site Rental were for generic rallies
    and have been re-classed to Line 30b.  15.\tThe payments made for Equipment Expense,
    Equipment Rental, and Event Expense have been more clearly identified as generic/GOTV
    \ rally expenses and re-classed to Line 30b   16.\tNone of the funds received
    from the transfers from the DCC or DNC were used in making payments for exempt
    activity.  17.\tThe memo entries have been correctly attached to their corresponding
    reimbursements/payroll payments on Schedule B and H4  18.\tRegarding the payroll
    and related payments listed on H4: no employee spent more than 25% of his/her
    time on FEA activity nor in connection with a federal election.  19.\tThe payments
    made for event expense listed on H4 have been more clearly described and re-classed
    to Line 30b as generic rally expenses.  20.\tThe payments listed on H4 for Telecommunications
    have been more clearly described as Admin Telephone\n"
